### Summary of Core Topics, Concepts, Principles, and Equations

The exam focuses on the subject "Foundation Level: English I (Computer Based Exam)" and covers a range of topics related to English language proficiency. Here are the core areas to study:

#### 1. **Reading Comprehension**
   - **Concepts:** Understanding and interpreting written passages, identifying synonyms, and understanding phrases in context.
   - **Principles:** Read the passage carefully, identify key points, and answer questions based on the text.
   - **Example Questions:**
     - What is the synonym of the word "surpassed"?
     - What is the meaning of the phrase "taken a hit"?

#### 2. **Vocabulary**
   - **Concepts:** Knowledge of synonyms, antonyms, and word meanings.
   - **Principles:** Use context clues to determine the meaning of words and phrases.
   - **Example Questions:**
     - What is the synonym of the word "tanking"?
     - What is the meaning of the word "debut"?

#### 3. **Grammar**
   - **Concepts:** Parts of speech (nouns, pronouns, verbs, adjectives, adverbs, conjunctions, prepositions), verb forms, and sentence structure.
   - **Principles:** Identify the correct part of speech, verb forms, and sentence structure in given sentences.
   - **Example Questions:**
     - Identify the part of speech of the underlined word: "They were quick to throw up their hands in surrender."
     - Complete the sentence by choosing the correct form of the verb given in brackets: "They ______ (buy) the house last year."

#### 4. **Phonetics and Pronunciation**
   - **Concepts:** Understanding vowel and consonant sounds, diphthongs, and semi-vowels.
   - **Principles:** Identify words based on their sounds and pronunciation patterns.
   - **Example Questions:**
     - Choose the word without an “ii” sound from the following.
     - Which semi-vowel occurs in the transition between the words ‘me’ and ‘off’ in the sentence ‘he pushed me off the chair’?

#### 5. **Word Collocation**
   - **Concepts:** Understanding common word pairings and phrases.
   - **Principles:** Match words with their commonly associated words or phrases.
   - **Example Questions:**
     - Match the word "Bank" with a suitable option from Column B.
     - Match the word "Strong" with a suitable option from Column B.

#### 6. **Conversational English**
   - **Concepts:** Appropriate responses in telephonic conversations and everyday interactions.
   - **Principles:** Use appropriate phrases and responses in different contexts.
   - **Example Questions:**
     - Complete the blank in a telephonic conversation with an appropriate response.
     - What does the phrase "keep me in the loop" mean?

#### 7. **Phrasal Verbs**
   - **Concepts:** Understanding and using phrasal verbs correctly.
   - **Principles:** Identify and use phrasal verbs in sentences.
   - **Example Questions:**
     - Identify the separable phrasal verb out of the following options.
     - Fill in the blank with the appropriate phrasal verb: "The meeting __________ just before dinner."

